# Bienvenue à la fête populaire la plus immersive en VR, totalement free-to-play !

Attrape tes amis et plonge dans l’Oktoberfest – le parc à thème social VR ultime, rempli de manèges palpitants, d’attractions, d’adorables animaux de compagnie et d’un fun sans fin à travers d’innombrables jeux.

