🎢 Adrénaline garantie – Rotor, montagnes russes et de nombreux classiques de la fête foraine.

🍺 Barrel Hunt – Descends dans la nouvelle brasserie souterraine pour des parties de chat endiablées.

🎮 Jeux de fête foraine – Percute tes amis aux autos tamponneuses, sers les clients en pleine heure de pointe et deviens un pro de la musique dans Brass Band Hero.

