# Добро пожаловать в самый захватывающий VR-парк — и всё это бесплатно!

Зови друзей и погружайся в Oktoberfest – лучший социальный VR-аттракцион с безумными каруселями, домами с привидениями, милыми питомцами и бесконечным весельем во множестве игр.

