👀 **За что любят игроки**:

🎢 Аттракционы – Ротор, американские горки и ещё десятки культовых развлечений.

🍺 Barrel Hunt – Спустись в новые подземные погреба и сыграй в хаотичные салочки.

🎮 Ярмарочные игры – Катайся на автодроме, обслуживай клиентов в Order Rush и играй в ритм в Brass Band Hero.

🎯 Классические игровые будки – Проверь меткость в тире, сбей все банки или запускай лягушек с катапульты. 

💀 Кооперативный экшен – Стань лидером, побеждая волны призраков в Haunting Grounds!

🐾 Заведи питомца – Ухаживай за ним, тренируй и находи скрытые сокровища вместе с ним.

🧍‍♂️ Создай свой стиль – Традиционный, крутой или сумасшедший – покажи, какой ты есть!

🎉 На Oktoberfest всегда праздник!

👉 Присоединяйся к нам на Discord: bit.ly/OktoberfestVRDiscord
